pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";

contract AuctionNFT is ERC721, ERC721Burnable {
    string internal s_metadata;

    constructor(
        string memory _tokenName,
        string memory _tokenSymbol,
        string memory _metadataUri,
        address _auctionHost // deploy using a dao address ( optional )
    ) ERC721(_tokenName, _tokenSymbol) {
        s_metadata = _metadataUri;
        _safeMint(msg.sender, 0);
    }

    function _baseURI() internal view override returns (string memory) {
        return s_metadata;
    }

    function getMetadataUri() public view returns (string memory) {
        return s_metadata;
    }
}
","keccak256":"0xbecd4556613e8c142cf6e8cf4963d0e20bed9812f53499dec222f7ea29b400b7","license":"UNLICENSED"},"contracts/AuctionToken.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract AuctionToken is ERC20, ERC20Burnable, Ownable {
    
    constructor(
        string memory _tokenName,
        string memory _symbol,
        uint256 _maxTokens,
        address _auctionHost // later transfer the tokens ownership to auctionHost
    ) ERC20(_tokenName, _symbol) {
        _mint(msg.sender, _maxTokens * 10**decimals()); // should be a dao later.
    }

    /**
     * @param _bidder The person who calls the enter func in Auction
     * owner is dao
     * approval has to be done by the dao
     */
    function transferToBidder(address _bidder) external returns (bool) {
        transferFrom(owner(), _bidder, 1 * 10**decimals());
        return true;
    }
}","keccak256":"0x60223abf93351872be05662e721814703b673a5d815cf1c16a02f2b32b692681","license":"UNLICENSED"},"hardhat/console.sol":{"content":"// SPDX-License-Identifier: MIT
